import React, { Component } from "react";

class SignIn extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <button
                    onClick={() => {
                        this.props.method("admin", "admin");
                    }}
                ></button>
                <button></button>
            </div>
        );
    }
}

export default SignIn;
